<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\TrustedClient\Domain\TrustedClientRef;
use Civi\Lughauth\Features\Access\RelyingParty\Domain\RelyingPartyRef;
use Civi\Lughauth\Features\Access\SecurityAttribute\Domain\ValueObject\SecurityAttributeTrustedClientVO;
use Civi\Lughauth\Features\Access\SecurityAttribute\Domain\ValueObject\SecurityAttributeRelyingPartyVO;
use Civi\Lughauth\Features\Access\SecurityAttribute\Domain\ValueObject\SecurityAttributeResourceVO;
use Civi\Lughauth\Features\Access\SecurityAttribute\Domain\ValueObject\SecurityAttributeAttributeVO;
use Civi\Lughauth\Features\Access\SecurityAttribute\Domain\ValueObject\SecurityAttributeEnabledVO;
use Civi\Lughauth\Features\Access\SecurityAttribute\Domain\ValueObject\SecurityAttributeReadVisibilityVO;
use Civi\Lughauth\Features\Access\SecurityAttribute\Domain\ValueObject\SecurityAttributeWriteVisibilityVO;
use Civi\Lughauth\Features\Access\SecurityAttribute\Domain\ValueObject\SecurityAttributeVersionVO;
use Civi\Lughauth\Features\Access\SecurityAttribute\Domain\SecurityAttributeAttributes;
use PHPUnit\Framework\TestCase;

final class SecurityAttributeAttributesUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new SecurityAttributeAttributes();
        $trustedClientOneValue = $this->getMockBuilder(TrustedClientRef::class)->setConstructorArgs(['one'])->getMock();
        $trustedClientOtherValue = $this->getMockBuilder(TrustedClientRef::class)->setConstructorArgs(['other'])->getMock();
        $copy = $value->trustedClient($trustedClientOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals($this->getMockBuilder(TrustedClientRef::class)->setConstructorArgs(['one'])->getMock(), $value->getTrustedClient());
        $this->assertNotEquals($this->getMockBuilder(TrustedClientRef::class)->setConstructorArgs(['other'])->getMock(), $value->getTrustedClient());
        $this->assertEquals($this->getMockBuilder(TrustedClientRef::class)->setConstructorArgs(['one'])->getMock(), $value->getTrustedClientOrDefault(SecurityAttributeTrustedClientVO::from($trustedClientOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(TrustedClientRef::class)->setConstructorArgs(['other'])->getMock(), $value->getTrustedClientOrDefault(SecurityAttributeTrustedClientVO::from($trustedClientOtherValue))->value());
        $value->unsetTrustedClient();
        $this->assertEquals($this->getMockBuilder(TrustedClientRef::class)->setConstructorArgs(['other'])->getMock(), $value->getTrustedClientOrDefault(SecurityAttributeTrustedClientVO::from($trustedClientOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(TrustedClientRef::class)->setConstructorArgs(['one'])->getMock(), $value->getTrustedClientOrDefault(SecurityAttributeTrustedClientVO::from($trustedClientOtherValue))->value());
        $relyingPartyOneValue = $this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['one'])->getMock();
        $relyingPartyOtherValue = $this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['other'])->getMock();
        $copy = $value->relyingParty($relyingPartyOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['one'])->getMock(), $value->getRelyingParty());
        $this->assertNotEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['other'])->getMock(), $value->getRelyingParty());
        $this->assertEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['one'])->getMock(), $value->getRelyingPartyOrDefault(SecurityAttributeRelyingPartyVO::from($relyingPartyOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['other'])->getMock(), $value->getRelyingPartyOrDefault(SecurityAttributeRelyingPartyVO::from($relyingPartyOtherValue))->value());
        $value->unsetRelyingParty();
        $this->assertEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['other'])->getMock(), $value->getRelyingPartyOrDefault(SecurityAttributeRelyingPartyVO::from($relyingPartyOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['one'])->getMock(), $value->getRelyingPartyOrDefault(SecurityAttributeRelyingPartyVO::from($relyingPartyOtherValue))->value());
        $resourceOneValue = 'one';
        $resourceOtherValue = 'other';
        $copy = $value->resource($resourceOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getResource());
        $this->assertNotEquals('other', $value->getResource());
        $this->assertEquals('one', $value->getResourceOrDefault(SecurityAttributeResourceVO::from($resourceOtherValue))->value());
        $this->assertNotEquals('other', $value->getResourceOrDefault(SecurityAttributeResourceVO::from($resourceOtherValue))->value());
        $value->unsetResource();
        $this->assertEquals('other', $value->getResourceOrDefault(SecurityAttributeResourceVO::from($resourceOtherValue))->value());
        $this->assertNotEquals('one', $value->getResourceOrDefault(SecurityAttributeResourceVO::from($resourceOtherValue))->value());
        $attributeOneValue = 'one';
        $attributeOtherValue = 'other';
        $copy = $value->attribute($attributeOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getAttribute());
        $this->assertNotEquals('other', $value->getAttribute());
        $this->assertEquals('one', $value->getAttributeOrDefault(SecurityAttributeAttributeVO::from($attributeOtherValue))->value());
        $this->assertNotEquals('other', $value->getAttributeOrDefault(SecurityAttributeAttributeVO::from($attributeOtherValue))->value());
        $value->unsetAttribute();
        $this->assertEquals('other', $value->getAttributeOrDefault(SecurityAttributeAttributeVO::from($attributeOtherValue))->value());
        $this->assertNotEquals('one', $value->getAttributeOrDefault(SecurityAttributeAttributeVO::from($attributeOtherValue))->value());
        $enabledOneValue = true;
        $enabledOtherValue = false;
        $copy = $value->enabled($enabledOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->getEnabled());
        $this->assertNotEquals(false, $value->getEnabled());
        $this->assertEquals(true, $value->getEnabledOrDefault(SecurityAttributeEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(false, $value->getEnabledOrDefault(SecurityAttributeEnabledVO::from($enabledOtherValue))->value());
        $value->unsetEnabled();
        $this->assertEquals(false, $value->getEnabledOrDefault(SecurityAttributeEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(true, $value->getEnabledOrDefault(SecurityAttributeEnabledVO::from($enabledOtherValue))->value());
        $readVisibilityOneValue = 'PUBLIC';
        $readVisibilityOtherValue = 'AUTHORIZED';
        $copy = $value->readVisibility($readVisibilityOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('PUBLIC', $value->getReadVisibility());
        $this->assertNotEquals('AUTHORIZED', $value->getReadVisibility());
        $this->assertEquals('PUBLIC', $value->getReadVisibilityOrDefault(SecurityAttributeReadVisibilityVO::from($readVisibilityOtherValue))->value());
        $this->assertNotEquals('AUTHORIZED', $value->getReadVisibilityOrDefault(SecurityAttributeReadVisibilityVO::from($readVisibilityOtherValue))->value());
        $value->unsetReadVisibility();
        $this->assertEquals('AUTHORIZED', $value->getReadVisibilityOrDefault(SecurityAttributeReadVisibilityVO::from($readVisibilityOtherValue))->value());
        $this->assertNotEquals('PUBLIC', $value->getReadVisibilityOrDefault(SecurityAttributeReadVisibilityVO::from($readVisibilityOtherValue))->value());
        $writeVisibilityOneValue = 'PUBLIC';
        $writeVisibilityOtherValue = 'AUTHORIZED';
        $copy = $value->writeVisibility($writeVisibilityOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('PUBLIC', $value->getWriteVisibility());
        $this->assertNotEquals('AUTHORIZED', $value->getWriteVisibility());
        $this->assertEquals('PUBLIC', $value->getWriteVisibilityOrDefault(SecurityAttributeWriteVisibilityVO::from($writeVisibilityOtherValue))->value());
        $this->assertNotEquals('AUTHORIZED', $value->getWriteVisibilityOrDefault(SecurityAttributeWriteVisibilityVO::from($writeVisibilityOtherValue))->value());
        $value->unsetWriteVisibility();
        $this->assertEquals('AUTHORIZED', $value->getWriteVisibilityOrDefault(SecurityAttributeWriteVisibilityVO::from($writeVisibilityOtherValue))->value());
        $this->assertNotEquals('PUBLIC', $value->getWriteVisibilityOrDefault(SecurityAttributeWriteVisibilityVO::from($writeVisibilityOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(SecurityAttributeVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(SecurityAttributeVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(SecurityAttributeVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(SecurityAttributeVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
